import React, { Component } from 'react';
import Pdf from '../../documents/Pradipta Basu.pdf';

class InternationalResume extends Component {

  render() {
    return (
      <div>
        <a href = {Pdf} target = "_blank">Download Pdf</a>
      </div>
    );
  }
}

export default InternationalResume;
